(4137, 1719, '2015-09-08 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra equipo encendido sin capturar , debido a que la tarjeta de memoria se encontraba con formato FAT32 almacenando la misma sólo 21844 archivos por carpeta. Se realiza la bajada del equipo y se formatea la tarjeta con el formato NTFS y el mismo queda funcionando OK. ""FIN DE ORDEN"".', 867, 9, '2015-09-08 10:46:36'),
