INSERT INTO `reparaciones_main` (`id`, `idequipo`, `fecha`, `prioridad`, `estado`, `origen`, `detalles`, `idusuario`, `supervisor`, `falta`) VALUES
(4321, 1761, '2015-10-02 00:00:00', 1, 9, 0, 'Se Recibe en CECAITRA el equipo completo, montado en el móvil C23, presentando problemas que no reconocía la memoria micro sd el programa Sciv. Se procede a realizar la reparación necesaria y las pruebas correspondiente verificando el correcto funcionamiento. ""FIN DE ORDEN""\r\n', 866, 12, '2015-10-02 17:01:31'),
(4322, 1763, '2015-10-02 00:00:00', 1, 9, 0, 'Se Recibe en CECAITRA el equipo completo, montado en el móvil C07, presentando problemas que no reconocía la memoria micro sd el programa Sciv. Se procede a realizar la reparación necesaria y las pruebas correspondiente verificando el correcto funcionamiento. ""FIN DE ORDEN""\r\n', 866, 12, '2015-10-02 17:02:53'),
(4323, 1759, '2015-10-01 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra funcionando sin reconocer la tarjeta de memoria. Se extrajo la misma y se la formateó. Se realiza la copia de información del equipo a la memoria y posteriormente la bajada de la misma. Equipo queda capturando OK con la memoria sin información. ""FIN DE ORDEN"".', 866, 9, '2015-10-05 09:49:18'),
(4324, 1654, '2015-10-02 00:00:00', 1, 9, 0, 'Se realizo orientación de cámara y se conecto el ventilador cooler. Se realizo un chequeo general. Equipo OK. ""FIN DE ORDEN"" ', 867, 9, '2015-10-05 09:52:20'),
(4325, 1679, '2015-10-01 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra con cámara desviada. Se corrige la misma. El equipo queda capturando OK. (Posee archivos 12500 archivos desde el día 07/08/15 al día de la fecha). ""FIN DE ORDEN"".', 866, 9, '2015-10-05 09:54:09'),
(4326, 1655, '2015-10-02 00:00:00', 1, 9, 0, 'Se conecto el ventilador  cooler, se realizo un chequeo general. Equipo OK. ""FIN DE ORDEN""', 867, 9, '2015-10-05 09:55:16'),
(4327, 1680, '2015-10-01 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra sin capturar con error del tControl. Se reinicia programa, se corrige posición de cámara ya que estaba desviada. Equipo queda capturando OK. (Posee 1200 archivos desde el día 31/08 al día de la fecha) ""FIN DE ORDEN"".', 866, 9, '2015-10-05 09:55:24'),
(4328, 1653, '2015-10-02 00:00:00', 1, 9, 0, 'Se conecto ventilador cooler, se realizo un chequeo general. Equipo OK. ""FIN DE ORDEN""', 867, 9, '2015-10-05 09:58:55'),
(4329, 1681, '2015-10-01 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra housing de cámara desviado y vandalizado. Equipo no posee tensión de alimentación. Se realiza orientación de la cámara y se prueba equipo con batería constatando su correcto funcionamiento. Se deja todo instalado, preparado para su funcionamiento cuando se reestablezca el suministro eléctrico. ""FIN DE ORDEN"".', 866, 9, '2015-10-05 10:04:10'),
(4330, 1682, '2015-10-02 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra con cámara desviada y con "Error en tiempo de ejecución 076" en programa tControl. Se verifica que la tarjeta de memoria no poseía la carpeta Imagen2 donde son guardados los archivos. Se crea dicha carpeta. Se corrige posición de cámara. Equipo queda funcionando OK. ""FIN DE ORDEN"".', 866, 9, '2015-10-05 10:06:28'),
(4331, 1822, '2015-10-02 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra equipo capturando sin imagen de cámara. Se reinicia equipo debido a que el inconveniente se encontraba en placa capturadora de video. Equipo queda funcionando OK. ""FIN DE ORDEN"".', 866, 9, '2015-10-05 10:10:48'),
(4332, 1821, '2015-10-02 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra equipo sin fotos. Se reinicia módulo de medición y se realiza foto de prueba con vehículo de la empresa. Se deja equipo sin fotos y funcionando OK. ""FIN DE ORDEN"".', 866, 9, '2015-10-05 10:13:31'),
(4333, 1639, '2015-10-02 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra equipo con "Error en tiempo de ejecución 076" en programa tControl. Se reinicia el programa y el equipo comienza a capturar OK. ""FIN DE ORDEN"".', 866, 9, '2015-10-05 10:17:49'),
(4334, 1636, '2015-10-02 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encontró con timer en "ON" y no automático. Se ajusta timer con la programación. Se ajusta ficha de teclado del equipo debido a que el mismo no capturaba foto de reinicio ni infracción. Equipo queda funcionando OK. ""FIN DE ORDEN"".', 866, 9, '2015-10-05 10:18:47'),
(4335, 1001, '2015-10-01 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. El mismo se encuentra apagado por no tener tensión. Se controla que posee tendido de tensión pero el mismo no se encuentra conectado. Queda Apagado.', 866, 9, '2015-10-05 10:24:03'),
