(4365, 1379, '2015-10-07 00:00:00', 1, 9, 0, 'Se encuentra equipo capturando con imagen en negro, se reinicia cámara y equipo. Se realizan las pruebas correspondientes corroborando su buen funcionamiento. Equipo OK. ""FIN DE ORDEN""', 867, 9, '2015-10-07 17:02:53'),
