(4367, 1762, '2015-10-08 00:00:00', 1, 9, 0, 'Se Recibe en CECAITRA el equipo completo, montado en el móvil C13, presentando problemas de Dilay entre foto y foto, debido a un problema con la memoria micro sd. Se procede a realizar la reparación necesaria y las pruebas correspondiente verificando el correcto funcionamiento.  ""FIN DE ORDEN""\r\n', 866, 12, '2015-10-08 11:27:55'),
