(4370, 1378, '2015-10-05 00:00:00', 1, 9, 0, 'Se paso a controlar equipo y se encontró ficha RCA cortada, se realizan las reparaciones correspondientes, se corrobora su buen funcionamiento. Equipo OK. ""FIN DE ORDEN""', 867, 9, '2015-10-09 09:17:15'),
(4371, 1471, '2015-10-06 00:00:00', 1, 9, 0, 'Se paso a controlar equipo y se encontró teclado desconectado. Se realizan los ajustes correspondientes. Equipo OK. ""FIN DE ORDEN""', 867, 9, '2015-10-09 09:19:12'),
(4372, 1424, '2015-10-07 00:00:00', 1, 9, 0, 'Se paso a controlar equipo y se encontró apagado, se enciende, se realiza un chequeo general. Equipo OK. ""FIN DE ORDEN""', 867, 9, '2015-10-09 09:21:44'),
(4373, 1401, '2015-10-08 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra disco D colgado. Se reinicia. Equipo queda funcionando OK. ""FIN DE ORDEN"".', 867, 9, '2015-10-09 09:29:25'),
(4374, 1385, '2015-10-08 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encuentra el emulador activado. Se desactiva. Equipo queda funcionando OK. ""FIN DE ORDEN"".', 867, 9, '2015-10-09 09:30:03'),
(4375, 1763, '2015-10-09 00:00:00', 1, 9, 0, 'Se Recibe en CECAITRA el equipo completo, montado en el Móvil C07, presentado una supuesta falla que se tilda, se realizan las pruebas en conjunto con el personal de operativo y se verifica que el equipo completo funciona correctamente. ""FIN DE ORDEN""\r\n', 866, 12, '2015-10-09 12:47:44'),
(4376, 1825, '2015-10-09 00:00:00', 1, 9, 0, 'Se paso a controlar equipo y se encontró que debido a las ramas no se podía ver el semáforo así que se procedió a orientar la cámara hasta ver el semáforo de arriba, se calibro espira y se realizo un chequeo general del equipo. Equipo OK. ""FIN DE ORDEN""', 867, 9, '2015-10-09 14:39:08'),
(4377, 1681, '2015-10-09 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se procedió a cambiar el frente del housing, se controló el foco, zoom y orientación de la cámara y se probó con una batería ya que no hay tensión de 220v. Equipo funciona OK. ""FIN DE ORDEN"".', 867, 9, '2015-10-09 14:42:22'),
(4378, 1682, '2015-10-09 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se notó que estaba el housing roto en la parte trasera. Se procedió a cambiar ambas tapas. El equipo está funcionando OK. ""FIN DE ORDEN"".', 867, 9, '2015-10-09 14:46:07'),
(4379, 1679, '2015-10-09 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se procedió a cambiar el brazo del housing haciendo dirección de cámara dejándolo en foco. Se notó que sensaba mal. Se acomodaron las fichas del sensado dejándolo funcionando OK. ""FIN DE ORDEN"".', 867, 9, '2015-10-09 14:48:12'),
(4380, 1680, '2015-10-09 00:00:00', 1, 9, 0, 'Se pasó a controlar equipo. Se encontró encendido pero con error de captura. Se reinició el programa. Equipo quedó funcionando OK. ""FIN DE ORDEN"".', 867, 9, '2015-10-09 14:49:13'),
